// props -- properties 
// pass the information from one com[ponent to another component
// declare -- {}
// props are immutable -- we cant able to update 

// destructuring -- multines props to make  sinlge ;line props\
// prop-types -- used to validate the data types 
// npm i prop-types

import PropTypes from "prop-types"

function App(props){
    const{name,city,age,state}=props
    return(
        <div>
       <p>
        Name:{name}<br/>
        city:{city}<br/>
        age:{age}<br/>
        state:{state}
       </p>
        </div>
    )
}



App.propTypes={
    name:PropTypes.string,
    city:PropTypes.array,
    age:PropTypes.number,
    state:PropTypes.string
}
App.defaultProps={
    name:"Raghavendra",
    city:["banglore","chennsi","hyderabad"],
    age:"25",
    state:"Karnataka"
}



export default App;
